import React, { useEffect } from 'react';
import { connect } from 'react-redux';
import axios from 'axios';
import { setUserInfo } from '../redux/actions/productActions';

const HomePage = (props) => {
  const { setUserInfo, userSignIn } = props;

  const fetchUserProfile = async (userSignIn) => {
    try {
      const response = await axios.get("/profile", {
        headers: {
          Authorization: userSignIn,
        },
      });
  
      const profileData = response.data;
      console.log(profileData); // Kullan覺c覺 profil verileri
    } catch (error) {
      console.error(error);
    }
  };

  console.log(userSignIn, "userSignIn");

  useEffect(() => {
    fetchUserProfile();
  }, [userSignIn]);

  return (
    <div>Home Page</div>
  );
};

const mapStateToProps = (state) => ({
  userSignIn: state.userSignIn.userSignIn.token,
});

const mapDispatchToProps = {
  setUserInfo,
};

export default connect(mapStateToProps, mapDispatchToProps)(HomePage);
